def fram(text, width=80, height=24, fill=' '):
    """
    Return a string of ASCII characters that look like a frame.
    """
    if width < 2 or height < 2:
        return ''
    if width < len(text):
        text = text[:width]
    if height < len(text):
        text = text[:height]
    if fill == ' ':
        fill = ' '
    else:
        fill = '*'
    frame = fill * width
    frame += '\n'
    for i in range(height - 2):
        frame += fill + text + fill + '\n'
    frame += fill * width
    return frame

