	void deleteLine(String fileName, int lineNumber) throws IOException{
		BufferedReader br = new BufferedReader(new FileReader(fileName));
		String line = br.readLine();
		int cnt = 1;
		while(line != null){
			if(cnt != lineNumber){
				System.out.println(line);
			}
			line = br.readLine();
			cnt++;
		}
		br.close();
	}
}
