	public static String encrypt(String plaintext, String key){
		String ciphertext = "";
		int[] key_schedule = key_expansion(key);
		int[] plaintext_schedule = plaintext_to_schedule(plaintext);
		int[] ciphertext_schedule = encrypt_schedule(plaintext_schedule, key_schedule);
		ciphertext = schedule_to_ciphertext(ciphertext_schedule);
		return ciphertext;
	}
	public static String decrypt(String ciphertext, String key){
		String plaintext = "";
		int[] key_schedule = key_expansion(key);
		int[] ciphertext_schedule = ciphertext_to_schedule(ciphertext);
		int[] plaintext_schedule = decrypt_schedule(ciphertext_schedule, key_schedule);
		plaintext = schedule_to_plaintext(plaintext_schedule);
		return plaintext;
	}
	public static int[] plaintext_to_schedule(String plaintext){
		int[] schedule = new int[plaintext.length() * 8];
		for(int i = 0; i < plaintext.length(); i++){
			int temp = (int)plaintext.charAt(i);
