	public static void cutFile(String fileName, String newFileName, int start, int end){
		try{
			FileInputStream fis = new FileInputStream(fileName);
			FileOutputStream fos = new FileOutputStream(newFileName);
			int len = (end - start) + 1;
			byte[] buffer = new byte[len];
			fis.skip(start);
			fis.read(buffer);
			fos.write(buffer);
			fis.close();
			fos.close();
		}catch(Exception e){
			e.printStackTrace();
		}
	}
