	void addGame(String name, String developer, String publisher, String releaseDate, String genre, String platform, String rating, String description){
		String sql = "INSERT INTO games (name, developer, publisher, releaseDate, genre, platform, rating, description) VALUES (?, ?, ?, ?, ?, ?, ?, ?)";
		try{
			PreparedStatement pst = conn.prepareStatement(sql);
			pst.setString(1, name);
			pst.setString(2, developer);
			pst.setString(3, publisher);
			pst.setString(4, releaseDate);
			pst.setString(5, genre);
			pst.setString(6, platform);
			pst.setString(7, rating);
			pst.setString(8, description);
			pst.executeUpdate();
		}catch(Exception e){
			e.printStackTrace();
		}
	}
